{
    DEBUGMSGTL(("internal:wifiBssWpaTable:_wifiBssWpaTable_container_shutdown","called\n"));

    wifiBssWpaTable_container_shutdown(if_ctx->container);

    _container_free(if_ctx->container);

} /* _wifiBssWpaTable_container_shutdown */


wifiBssWpaTable_rowreq_ctx *
wifiBssWpaTable_row_find_by_mib_index(wifiBssWpaTable_mib_index *mib_idx)
{
    wifiBssWpaTable_rowreq_ctx   *rowreq_ctx;
    oid                      oid_tmp[MAX_OID_LEN];
    netsnmp_index            oid_idx;
    int                      rc;

    /*
     * set up storage for OID
     */
    oid_idx.oids = oid_tmp;
    oid_idx.len = sizeof(oid_tmp)/sizeof(oid);

    /*
     * convert
     */
    rc = wifiBssWpaTable_index_to_oid(&oid_idx, mib_idx);
    if (MFD_SUCCESS != rc)
        return NULL;

    rowreq_ctx = (wifiBssWpaTable_rowreq_ctx*)CONTAINER_FIND(wifiBssWpaTable_if_ctx.container, &oid_idx);

    return rowreq_ctx;
}
